  return (
    <div>
      <Content
        image = {logo}
        title = "첫 번째 콘텐츠"
        description = "리액트 연습"
      />
      <Content
        image = {logo}
        title = "두 번째 콘텐츠"
        description = "리액트 연습!"
      />
    </div>
    
  );
}

export default Main;
